import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

function OptimizedLineup() {
  const location = useLocation();
  const navigate = useNavigate();
  const { optimizedLineup } = location.state || {};

  if (!optimizedLineup) {
    return <div>No optimized lineup available. Please go back and try again.</div>;
  }

  const handleGoBack = () => {
    navigate(-1);
  };

  return (
    <div className="optimized-lineup">
      <h2>Optimized Lineup</h2>
      <div className="lineup-grid">
        {optimizedLineup.map((player, index) => (
          <div key={index} className="player-item optimized">
            <div className="player-name">{player.playerName}</div>
            <div className="player-details">
              {player.position} â€¢ {player.teamName}
            </div>
            <div className="player-projection">
              Projected: {player.projectedPoints.toFixed(2)}
            </div>
          </div>
        ))}
      </div>
      <button onClick={handleGoBack} className="back-button">Back to Roster</button>
    </div>
  );
}

export default OptimizedLineup;
